import csv
import sys
def create_csv_writer(filename):
    return csv.writer(open(filename, 'w'),
                      quoting=csv.QUOTE_ALL)
def create_csv_reader(filename):
    return csv.reader(open(filename, 'r'),
                      quoting=csv.QUOTE_ALL)
def main(argv):
    # open the CSV files
    reader = create_csv_reader('input.csv')
    writer = create_csv_writer('output.csv')
    for line in reader:
        # write the output
        writer.writerow(line)
if __name__ == '__main__':
    main(sys.argv[1:])

CoT_5:
# If today is the palindrome day of 2020, then today is the date that the MMDDYYYY format of the date is the same backwards as forwards.
# We can brute-force it.
for day in range(1, 31):
    for month in range(1, 13):
        today = datetime(2020, month, day)
        if today.strftime('%m%d%Y') == today.strftime('%Y%d%m'):
            print(today.strftime('%m/%d/%Y'))
